import React from "react";

export const Page1 = () => {
  return (
    <div className="page1">
      <div className="page1_inner">
        <div className="page1__heading">Landing template for startups</div>
        <div className="page1__paragraph">
          Our landing page template works on all devices, so you only have to
          set it up once, and get beautiful results forever.
        </div>
        <div className="page1__buttons">
          <button className="page1__button1">Start free trial</button>
          <button className="page1__button2"></button>
        </div>
      </div>
    </div>
  );
};
